import { Question } from "./components/Question.js";
import { QuestionNavbar } from "../QuestionNavbar.js";

export const Study19 = () => {
  return (
    <div className="questions">
      <QuestionNavbar />
      <Question
        title={
          "Hienoa! Jutun suunnitelma onkin jo valmis! Haluatko vielä pohtia juttuprosessia?​​​​​"
        }
        options={[
          {
            value:
              "Haluan vielä pohtia juttuprosessia reiluuden eri näkökulmista.​​​",
            navigate: "info/28",
          },
          {
            value:
              "Haluan aloittaa uuden juttuprosessin.​​​​",
            navigate: "study/3",
          },
          {
            value: "Kiitos sain jo tarvitsemani avun.​​​​",
            navigate: "info/27",
          },
        ]}
      />
    </div>
  );
};
